import React from 'react';
import uccplogo from '../assets/uccplogo.png';
import schlogo from '../assets/schlogo.png';

function Login() {
  return (
    <div className=''>
      <div className='flex bg-custom-green h-20 items-center'>
        <div className='mr-2'>
          <img src={uccplogo} alt="" className='h-16 w-16 lg:h-20 lg:w-20 transition-all duration-300' />
        </div>
        <div className=''>
          <img src={schlogo} alt="" className='h-20 w-20 lg:h-24 lg:w-24 transition-all duration-300' />
        </div>
        <div className='ml-4 flex-grow'>
          <p className='text-white text-sm lg:text-2xl font-custom-font transition-all duration-300'>CAGAYAN DE ORO CHRISTIAN SCHOOL - UCCP</p>
        </div>
        {/* Navigation Bar */}
        <div className='flex items-center mr-5'>
          <a href='#' className='text-white mr-4 lg:text-2xl'>About</a>
          <a href='#' className='text-white mr-4 lg:text-2xl'>Contact</a>
          <a href='#' className='text-white lg:text-2xl'>Sign In</a>
        </div>
      </div>
    </div>
  );
}

export default Login;
